  #blur-box1 {
  display: none;
  position: absolute;
  top: 50%;
  left: 50%;
  transform: translate(-50%, -50%);
  padding: 31px;
  width: 95%;
  height: 93%;
  background-color: rgba(0, 0, 0, 0);
  backdrop-filter: blur(0px);
  border-radius: 10px;
  color: rgba(255, 255, 255, 0.774);
  text-align: center;
  animation: fadein 1s forwards;
  }


  #profile-picture {
  width: 100px;
  height: 100px;
  background-color: #ffffff00;
  border-radius: 50%;
  position: absolute;
  top: 30%;
  left: 50%;
  transform: translate(-50%, -50%);
  overflow: hidden;
  }

  #profile-picture img {
  width: 100%;
  height: 100%;
  object-fit: cover;
  }

  #username {
  font-size: 35px;
  margin-top: 130px;
  text-shadow: 0 0 15px rgba(255, 255, 255, 0.8);
  }

  #bio {
  font-size: 18px;
  margin-top: 10px;
  text-shadow: 0 0 15px rgba(255, 255, 255, 0.8);
  }


  #video-background {
  display: none;
  position: absolute;
  top: 0;
  left: 0;
  width: 100%;
  height: 100%;
  object-fit: cover;
  z-index: -1;
  animation: fadein 1s forwards;
  }

  .glowing-text {
  color: white;
  text-shadow: 0 0 20px rgba(255, 255, 255, 0.8);
  }   

  .next {
  top: 50%;
  left: 50%;
  color: #fff;
  position: absolute;
  font-weight: normal;
  font-size: 20px;
  transform: translate(-50%, -50%);
  font-family: "Segoe UI", "Source Sans Pro", Calibri, Candara, Arial, sans-serif;
  }

  .glass-box {
    color: rgba(255, 255, 255, 0);
    text-shadow: 0 0 10px rgb(255, 255, 255);
    height: 100%;
    background: rgb(0, 0, 0);
    border: 2px solid #ffffff;
    position: absolute;
    display: inline-block;
    align-items: center;
    justify-content: center;
    backdrop-filter: blur(10px); 
    z-index: 999;
    display: inline-block; 
    flex-direction: column;
    align-items: center;
    box-sizing: border-box; 
  }

#cursor-tail {
  width: 150px;
  height: 150px;
  background: radial-gradient(circle at top left, pink, transparent 70%, transparent), 
              radial-gradient(circle at bottom right, blue, transparent 70%, transparent);
  position: fixed;
  border-radius: 50%;
  pointer-events: none;
  z-index: 9999;
  opacity: 0;
  transition: opacity 1s ease;
  animation: spin 12s linear infinite;
}

#cursor-tail.visible {
  opacity: 0;
}

@keyframes spin {
  0% {
    transform: rotate(0deg);
  }
  100% {
    transform: rotate(360deg);
  }
}

/* Stars */
.star {
  position: absolute;
  width: 2px;
  height: 2px;
  background-color: #fff;
  border-radius: 50%;
  animation: twinkle 2s infinite;
}

@keyframes twinkle {
  0% {
    opacity: 0;
  }
  50% {
    opacity: 1;
  }
  100% {
    opacity: 0.3;
  }
}
